import "./App.css";
import Header from "./views/header";
import Project from "./views/project";
import LazyLoad from "react-lazyload";

function App() {
  return (
    <div className="App">
      <div className="main-container">
        <div className="top">
          {" "}
          <Header />
        </div>
        <div className="main">
          {" "}
          <LazyLoad>
            <Project />
          </LazyLoad>
          <LazyLoad>
            <Project />
          </LazyLoad>
          <LazyLoad>
            <Project />
          </LazyLoad>
        </div>
      </div>
    </div>
  );
}

export default App;
